import React from 'react'
import WelcomeB from './WelcomeB';

interface IProps{

}
interface IState{

}

class WelcomeA extends React.Component<IProps,IState>
{
    constructor(props:IProps){
        super(props)
    }
  
render()
{
    return(
        <React.Fragment>

            
                    <div className='col-md-4'>
                        <div className='card'>
                            <div className='card-body'>
                                <div className='card-header'>
                                    <h2>WelcomeA</h2>
                                </div>
                            </div>
                        </div>
                    </div>
                

            <WelcomeB/>
        </React.Fragment>
    )
}
}
export default WelcomeA;
